void saveState(glm::ivec2 playerSpawnPos, int levelId)
{

	if(levelId == -2 || levelId >= LEVELS)
	{
		std::ofstream f;
		f.open("resources//state", std::ofstream::out | std::ofstream::trunc);
		f.close();
		return;
	}

	std::ofstream f("resources//state");
	
	if (!f.is_open()) { return; }

	int posX = playerSpawnPos.x;
	int posY= playerSpawnPos.y;

	f << posX << " " << posY << " " << levelId;
		
	f.close();
}

bool loadLevelFromLastState(int &level, glm::ivec2 &spawn)
{

	std::ifstream f("resources//state");

	if(!f.is_open() || f.eof())
	{
		level = -2;
		spawn = {};
		f.close();
		return 0;
	}else
	{
		f >> spawn.x >> spawn.y >> level;

		if (level == -2 || level >= LEVELS) {
			level = -2;
			return 0;
		}

		return 1;
	}

}